import React, { Component } from 'react';
import '../styles/navbar.scss';
import { slide as Menu } from "react-burger-menu";

export default props => {
    return (
        <Menu {...props}>
            <a className="menu-item" href="/">
            Home
            </a>
<a className="menu-item" href="#">
        About
    </a>

    <a className="menu-item" href="#">
        Selected work
    </a>

    <a className="menu-item" href="#">
        Contact
    </a>

</Menu>

    )
}

